Pollard rho algorithm is a randomized algorithm which factorizes a number in an average of \(O(n^{1/4})\) time. struct RNG { val: u64,
} impl RNG { /// Returns a new RNG instance starting with a given seed. fn new(seed: u64) -> Self { Self { val: seed } } /// Returns a random u64 number. fn next(&mut self) -> u64 { let mut x = self.val; x ^= x << 13; x ^= x >> 7; x ^= x << 17; self.val = x; x } /// Returns a random f64 number within [0, 1]. fn next_f64(&mut self) -> f64 { (self.next() as f64) / (u64::MAX as f64) } /// Returns a random u64 number within [l, r). fn range_u64(&mut self, l: u64, r: u64) -> u64 { l + self.next() % (r - l) } /// Returns a random i64 number within [l, r). fn range_i64(&mut self, l: i64, r: i64) -> i64 { l + (self.next() / 2) as i64 % (r - l) } /// Returns a random f64 number within [l, r]. fn range_f64(&mut self, l: f64, r: f64) -> f64 { l + self.next_f64() * (r - l) }
} trait Miller { fn rem_mul(x: Self, y: Self, m: Self) -> Self; fn rem_pow(base: Self, exp: Self, m: Self) -> Self; fn naive_primality(self) -> bool; fn miller_rabin(self, a: Self) -> bool; fn miller_primality(self) -> bool; fn is_prime(self) -> bool;
