} miller_rabin_impl!(u8, u16, 254, 2);
miller_rabin_impl!(u16, u32, 2000, 2, 3);
miller_rabin_impl!(u32, u64, 10000, 2, 7, 61);
miller_rabin_impl!(u64, u128, 1000000, 2, 325, 9375, 28178, 450775, 9780504, 1795265022); fn gcd(mut a: u64, mut b: u64) -> u64 { while b != 0 { let t = b; b = a % b; a = t; } a
} #[inline]
fn rem_add(a: u64, b: u64, m: u64) -> u64 { ((a as u128 + b as u128) % m as u128) as u64
} #[inline]
fn abs_diff(a: u64, b: u64) -> u64 { if a > b { a - b } else { b - a }
} fn factorize(mut n: u64, rng: &mut RNG) -> Vec<u64> { if n <= 1 { return Vec::new(); } let mut arr: Vec<u64> = Vec::new(); while n & 1 == 0 { n >>= 1; arr.push(2); } rho(n, &mut arr, rng); arr
} fn rho(n: u64, arr: &mut Vec<u64>, rng: &mut RNG) { if n <= 1 { return; } else if n.is_prime() { arr.push(n); return; } let mut i = 0u64; let mut x = rng.next() % n; let mut y = x; let mut k = 2u64; let mut d; let mut reset_limit = 500000; loop { i += 1; x = rem_add(Miller::rem_mul(x, x, n), n - 1, n); d = gcd(abs_diff(y, x), n); if d == n || i >= reset_limit { // Reset reset_limit = reset_limit * 3 / 2; i = 0; x = rng.next(); y = x; } if d != 1 { break; } if i == k { y = x; k <<= 1; } } if d != n { rho(d, arr, rng); rho(n / d, arr, rng); return; } i = 3; while i * i <= n { if n % i == 0 { rho(i, arr, rng); rho(d / i, arr, rng); return; } i += 2; }
}

